import React from 'react'
import Link from 'next/link'

const Navlink = ({ href, children }) => {
    return(
        <Link href={href}>
            <a>{children}</a>
        </Link>
    )
}


const Navbar = () => {
    return (
        <div className="bg-red-900 text-gray-100 font-semibold">
            <Navlink href={'/sobre'} >Sobre</Navlink>
            <Link href="/cadastro">
                <a>Cadastro</a>
            </Link>
            <Link href="/entrar">
                <a>Entrar</a>
            </Link>
        </div>
    )
}

export default Navbar
